import React from 'react';
import './style.css';

class Body extends React.Component {
  render = ()=>{
    return (
      <div className='body'>
        <p id="about" className='intro-header'>
        Hello I'm <b>Neil</b>
        a <b>sophomore</b> at the
        <b>University of California, Los Angeles (UCLA) </b> 
       </p>



      </div>
    );
  }
}

export default Body;
